import React from "react";
import { useQuery } from "@apollo/client";
import { ALL_CHARACTERS } from "./CharacterList";

export const CharacterList = (A) => {
  const { loading, data } = useQuery(ALL_CHARACTERS);

  return <>{loading ? <p>LOADING ...</p> : <p>data</p>}</>;
};
